&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Simplifique las cosas con una HP LaserJet Pro econ&oacute;mica y cartuchos de t&oacute;ner JetIntelligence. Produzca documentos profesionales desde una amplia gama de dispositivos m&oacute;viles y ahorre energ&iacute;a con una impresora l&aacute;ser compacta dise&ntilde;ada para brindar eficiencia.&lt;/p&gt;
